import { Grid } from "@mui/material";
import React from "react";
import PurchaseList from "../Receipt/PurchaseList";
import IngredientList from "../Recipe/IngredientList";

const Layout = () => {

  return (
    <div>
      <Grid container>
        <Grid item xs={6}>
          <IngredientList />
        </Grid>
        <Grid item xs={6}>
          <PurchaseList />
        </Grid>
      </Grid>
    </div>
  );
};

export default Layout;
